CREATE DEFINER=`root`@`%` PROCEDURE `sp_ReadTweetFromDb`(channel_id int, type varchar(255))
Begin

Select a.channel_id, a.post_stream_id, a.retrieved_at, a.created_at, 
b.*, c.screen_name, c.profile_image_url, c.name, c.description, c.following
from 
social_stream a inner join social_stream_twitter b on a.post_id = b.post_id 
inner join twitter_user_engaged c on
c.twitter_user_id = b.twitter_user_id

where b.type = type and a.type='twitter' and a.channel_id = channel_id
order by a.created_at desc;

end ;;
