/*!50003 DROP PROCEDURE IF EXISTS `sp_ReportPerformance` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ReportPerformance`(p_channel_id int, in p_group_id int, p_user_id int, date_start date, date_finish date)
BEGIN
declare my_code varchar(64);
set my_code = UUID();
select my_code;
if(p_group_id is null) then

Insert into report_performance (`code`, channel_name, channel_id, product_id, product_name, 
total_case, total_solved, average_response, case_type, user_group_id, user_group_name, type, type2, generated_by, created_at)
select my_code, concat(ch.name,' (', ch.country_code, ')') as channel,ch.channel_id, cp.id, cp.product_name, count(*) as total_case, count(c.solved_at) as total_solved, avg(UNIX_TIMESTAMP(solved_at) - UNIX_TIMESTAMP(c.created_at)) as average_response, 
	c.case_type , ug.group_id, ug.group_name as user_group, ss.`type`, sst.`type` as type2, 366653, NOW()
FROM `case` c inner join social_stream ss on c.post_id = ss.post_id
	inner join content_products cp on cp.id = c.content_products_id
	left join social_stream_twitter sst on sst.post_id = ss.post_id 
	inner join channel ch on ch.channel_id = ss.channel_id
	inner join (user u  inner join user_group ug on u.group_id = ug.group_id) on u.user_id = c.created_by 
WHERE ss.channel_id = p_channel_id and c.created_at >= date_start and c.created_at <= date_finish
	group by c.case_type, ss.type, cp.id, sst.type, u.group_id;
else

Insert into report_performance (`code`, channel_name, channel_id, product_id,  product_name, 
total_case, total_solved, average_response, case_type, user_group_id, user_group_name, type, type2, generated_by, created_at)
select my_code, concat(ch.name,' (', ch.country_code, ')') as channel,ch.channel_id,  cp.id, cp.product_name, count(*) as total_case, count(c.solved_at) as total_solved, avg(UNIX_TIMESTAMP(solved_at) - UNIX_TIMESTAMP(c.created_at)) as average_response, 
	c.case_type , ug.group_id, ug.group_name as user_group, ss.`type`, sst.`type` as type2, 366653, NOW()
FROM `case` c inner join social_stream ss on c.post_id = ss.post_id
	inner join content_products cp on cp.id = c.content_products_id
	left join social_stream_twitter sst on sst.post_id = ss.post_id 
	inner join channel ch on ch.channel_id = ss.channel_id
	inner join (user u  inner join user_group ug on u.group_id = ug.group_id) on u.user_id = c.created_by 
WHERE ss.channel_id = p_channel_id and ug.group_id = p_group_id and c.created_at >= date_start and c.created_at <= date_finish
	group by c.case_type, ss.type, cp.id, sst.type, u.group_id;
end if;

END ;;
DELIMITER ;
